Оранжевая футболка для девочек и мальчиков — классный акцент для любимых образов на каждый день!
Детская школьная футболка выполнена из 100% хлопка и дарит комфорт в любой ситуации.

Преимущества:

— 100% хлопок: натуральная ткань сохраняет ощущение свежести;

— футболка из трикотажа кулирная гладь отличается мягкостью и долговечностью;

— усиленные плечевые швы увеличивают прочность;

— однотонная футболка для детей и подростков легко сочетается с любым низом;

— подростковая футболка прямого кроя подходит для школы;

— хлопковая лаконичная футболка дарит комфорт;

— базовая футболка — универсальное решение для стильных образов;

— трикотажная футболка с коротким рукавом не сковывает движения.

 Классическая футболка подойдет для повседневных образов.

